import * as api from "../helpers/Api";

// action Creators
export const getEmployees = () => async (dispatch) => {
  try {
    const data = await api.fetchEmployees(
      "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYxNTJiNmU1OTExZjZiYzY3MmQzZDZmNSIsImlhdCI6MTYzMjgzOTE1MCwiZXhwIjoxNjM1NDMxMTUwfQ.XEAwacR7yXCLA01xqXdnxTYuGWbEXGaICpUwrg2uZcE"
    );
    dispatch({ type: "FETCH_ALL", payload: data });
  } catch (err) {
    console.log(err);
  }
};
